import React from 'react';
import './about.css';

const About = () => {


	return (
		<div className="about">
			<h1>Présentation</h1>
			<p>Développeur passionné dans le domaine du web depuis plus de 6 ans,
je prépare actuellement une alternance en tant que Développeur Web FullStack.
Je conçois et réalise des sites web du cahier des charges à la mise en ligne.
Je developpe aussi en JAVA, ce qui me permet de développer des applications mobiles android et aussi l’utilisation d’ETL tel que Talend.
</p>
        </div>
	);
};

export default About;
